import{_ as p}from"./chunks/theme.CFf5wXVw.js";import{_ as l,c as _,o as a,aG as r,G as i}from"./chunks/framework.CdnsPyyz.js";const f=JSON.parse('{"title":"零零碎碎的知识点","description":"","frontmatter":{"title":"零零碎碎的知识点","lang":"en-US","date":"2025/04/22 16:08:00","editLink":true,"categories":["博客"],"tags":["知识点"]},"headers":[],"relativePath":"blogs/零零碎碎的知识点.md","filePath":"blogs/零零碎碎的知识点.md","lastUpdated":1745720076000}'),o={name:"blogs/零零碎碎的知识点.md"};function s(n,t,c,m,d,g){const e=p;return a(),_("div",null,[t[0]||(t[0]=r("<ul><li>总和生育率： 总和生育率（TFR）是指一个国家或地区的妇女在育龄期间（通常为 15 至 49 岁）平均生育的子女数量。为了维持人口的长期稳定，即实现人口更替水平，一般认为总和生育率需要达到约 2.1 。这是因为在考虑到婴儿死亡率、性别比例等因素后，平均每个妇女生育约 2.1 个孩子，才能确保下一代人口数量与上一代大致相当。</li></ul><p>（我是这么理解的，一对夫妇2个人至少要生2个孩子，才能保持人口不下降，是这个道理么？）</p><hr><ul><li>皮格马利翁效应</li></ul><p>“皮格马利翁效应是指如果你对某人赋予强烈的期待，并且以最真诚的态度对待，这份期待就会变成现实。”</p><p>（期望效应/罗森塔尔效应）</p><hr><ul><li>什么是转移净收入</li></ul><p>转移净收入 = 转移性收入 - 转移性支出</p><p>转移性收入：比如离退休金、失业救济金、辞退金、保险索赔、住房公积金、养老金、子女给父母的赡养费等</p><p>转移性支出：缴纳税款、养老保险、医疗保险、赡养支出、捐赠支出、个人所得税、捐款</p><hr><ul><li>名义工资</li></ul><p>名义工资是指以货币数量表示的工资数额，也被称为货币工资。它是雇主在一定时期内支付给雇员的货币报酬，不考虑物价变动因素对货币购买力的影响。 （就是多少钱工资，名义工资上涨不一定意味这劳动者实际生活水平提高）</p><hr><p>人体每小时可以代谢10～15克酒精，代谢过程为乙醇-&gt;乙醛-&gt;乙酸-&gt;二氧化碳+水+能量 其中乙醛是具有细胞毒性和基因毒性的，所以乙醇是一类致癌物质。</p><hr><p>酒精度是怎么算的：比如13度的酒，表示的是每100ml酒中含有13ml酒精</p><hr>",19)),i(e,{src:"https://gitee.com/zackzhengxy/picGallery/raw/main/imgs/经常账户.png"})])}const T=l(o,[["render",s]]);export{f as __pageData,T as default};
